import React from 'react';

const PuppiesAvailable = () =>{
   const puppies = [
        {_id: 1, name: "Emma", gender: "Female", standing: "Sold", dob: "05/10/20" },
        {_id: 2, name: "Leo", gender: "Male", standing: "Sold", dob: "05/10/20", },
        {_id: 3, name: "Milo", gender: "Male", standing: "Sold", dob: "05/10/20", },
]
return (
<div>
        <h1></h1>
        <div className="PuppyHomeCard">
    {puppies.map(puppy =>
    <div>
        {puppy.id}

        {puppy.name}

        </div>
        )}

</div>
</div>
)
}
export default PuppiesAvailable;
